import React from 'react';
import { useNavigate } from 'react-router-dom';
import './NursePage.css'; // Assuming you'll have a CSS file for styling

const NursePage = () => {
  const navigate = useNavigate();

  // Handler to navigate to different forms
  const handleFormSelection = (formPath) => {
    navigate(formPath);
  };

  return (
    <div className="nurse-page">
      <h1>Nurse Dashboard</h1>
      <div className="form-options">
        <button onClick={() => handleFormSelection('/surveillanceform')}>
          Patient Administration Details
        </button>
        <button onClick={() => handleFormSelection('/surgery-form')}>
          Patient Surgery Details
        </button>
        <button onClick={() => handleFormSelection('/antibiotic-form')}>
          Patient Antibiotic Details
        </button>
        <button onClick={() => handleFormSelection('/microbiology-form')}>
          Patient Microbiology Details
        </button>
      </div>
    </div>
  );
};

export default NursePage;
